import React, { useState } from 'react';


const App = () => {
  const [good, setGood] = setGood(0)
  const [neutral, setNeutral] = setNeutral(0)
  const [bad, setBad] = setBad(0)

  const increaseGood = () => setGood(good + 1)

  return (
    <div>
      <button onClick={() => increaseGood(good+1)}>Good</button>
      <button onClick={() => setNeutral(neutral+1)}>Neutral</button>
      <button onClick={() => setBad(bad+1)}>Bad</button>

      {good}
      {neutral}
      {bad}
    </div>
)
}

export default App;
